import React from 'react';
import { connect } from 'react-redux';
import ProductItem from '../components/ProductItem';
import ProductList from '../components/ProductList';
import {addToCart} from '../actions';
import {store} from '../index';

var products=store.getState().products;
const FonudContainer=({products=products,addToCart,productsnum})=>(
     <div style={{width:'1000px',display:'flex',flexWrap:'wrap'}}>
      <ProductList foundnums={productsnum}>
         {
             products.map(
                 product=>
                 <ProductItem
                     key={product.id}
                     product={product}
                     addToCart={addToCart}
                   
                 />

            
             )
         }
         <div>{console.log("test",products)}</div>
      </ProductList>
     </div>
     )

const mapStateToProps=state=>({
   /*  products:state.products, */
    productsnum:state.products.length
})

 export default connect(mapStateToProps,{addToCart})(FonudContainer);
